property.value:
if(element.getChildren().length === 0)
{
    return "";
}

let defaultValueDetected = false;
let lastField = "";

element.getChildren("DTO-Field").every(child =>
{
    if((child.getValue() == null || child.getValue() == '') && defaultValueDetected === true)
    {
        lastField = child.getName();
        return false;
    }

    if(child.getValue() != null && child.getValue() != '' && lastField === "")
    {
        defaultValueDetected = true;
    }

    return true;
});

if(lastField === "")
{
    return "";
}

return {
    text : "Property [" + lastField + "] without a default value must precede properties with default values",
    type : "warning"
};

