    // Domain Interaction Settings -> Mapping Mode
    application.getSettings("0ecca7c5-96f7-449a-96b9-f65ba0a4e3ad")?.getField("14bc1e98-930b-494c-97a9-5da4e1f3a5fa")?.value !== "advanced";

