var namingConvention = application.getSettings("c4d1e35c-7c0d-4926-afe0-18f17563ce17")?.getField("c3789138-6649-47e4-901b-5f6469583cb7")?.value;

element.getChildren("DTO-Field").forEach(x => {
    if (namingConvention == "pascal-case") {
        x.setName(toPascalCase(x.getName()))
    } else if (namingConvention == "camel-case") {
        x.setName(toCamelCase(x.getName()))
    }
})
